User management plays a small part is how the chuck-stack operates. Almost all logic is tied to a role. PostgREST gives us a great roadmap for accomplishing this task. Here is a quick description of how chuck-stack manages users and roles: Users will be created in PostgreSQL with no privileges. Users will be granted access to a PostgreSQL role. This concept is called impersonation where the user logs in and quickly moved to a role. After the login is complete, all authorization is performed at the role level. Here is an example of impersonation: create role some_role nologin;
grant usage on schema private to some_role;
grant select on private.stk_business_partner to some_role;
create role some_user_auth noinherit login password 'some_password';
grant some_role to some_user_auth; psql -d some_db -U some_user_auth -c "set SESSION ROLE some_role" -c "select * from adempiere.c_bpartner limit 1" If you remove the "-c ... set ROLE ..." command, the psql statement will fail with a "permission denied" error because the some_user_auth role does not have any privileges. This example shows just how easily we can provide user management yet ensure that no user capabilities spill into role-based business logic. It is worth noting that user and role management is shared in both Linux and PostgreSQL. While these responsibilities exist in both planes, they are not duplicated. Linux dictates role-based tool access and how the user connects to the database. PostgreSQL dictates data access inside the database. Reference: PostgREST Authentication

