A big requirement of enterprise systems is managing a user's context inside the application. The above example of switching from the user to the role is great for simplifying business logic; however, the system still needs to know what user performed what action. The chuck-stack uses another concept from PostgREST to set session variables (context) using PostgreSQL's configuration settings. Here is an example where any business logic can check session variable details during a process. CREATE OR REPLACE FUNCTION check_user() RETURNS void AS $$
DECLARE email text := current_setting('stk.variable', true)::json->>'email';
BEGIN IF email = 'some_joe@bad.com' THEN RAISE EXCEPTION 'No, you are not allowed' USING HINT = 'Some additional details about the situation'; END IF;
END
$$ LANGUAGE plpgsql; Setting these variables during psql execution is easy ( see success with Linux ). Checking them during program execution is easy as demonstrated above.
